import "./AssignmentExpenseItem.css";
function AssignmentExpenseItem() {
  return (
    <div>
      <div className="expense-item">
        <div className="expense-date">
          <div className="expense-date__month"></div>
          <div className="expense-date__year"></div>
          <div className="expense-date__day"></div>
        </div>
        <div className="expense-item__description">
          <h2></h2>
          <div className="expense-item__price"></div>
        </div>
      </div>
    </div>
  );
}
export default AssignmentExpenseItem;
